import React from "react";
import { Route, Switch, BrowserRouter as Router } from "react-router-dom";
import Home from "./pages/home/Home";
import { store } from "./store";
import { connect } from "unistore/react";
import { actions } from "./store";
import SignIn from "./pages/signin/SignIn";
import SignUp from "./pages/signup/signup";
import Header from "./component/Header";
import Home1 from "./pages/Home1/Home";
import Profile from "./pages/profile/Profile";
import { Redirect } from "react-router-dom";
import Donasi5000 from "./pages/detail/5000";
import Donasi10000 from "./pages/detail/10000";
import Donasi50000 from "./pages/detail/50000";
import Detail from "./pages/detail/detail";
import Checkout from "./pages/checkout/checkout";
// import Mobil from "./component/mobil";
// import Barang from "./component/barang";
import Invoice from "./component/invoice";
import Home2 from "./home";
import NotFound from "./pages/notfound/NotFound";
import Footer from "./component/footer";
import Donasi from "./component/listDonasi";
// import FormPage from "./component/cobasignin";
import AddItem from "./component/tambahBarang";
import Delete from "./component/deletebarang";
import Transaksi from "./component/listtransaksi";

// import { Redirect } from 'react-router-dom';

// const is_login = JSON.parse(localStorage.getItem('is_login'));

class MainRoute extends React.Component {
  // postSignOut = () => {
  //   // const self = this;
  //   console.log(this.props.is_login);
  //   this.props.setLogin(false);
  //   console.log(this.props.is_login);
  // localStorage.setItem('is_login', null);

  // return <Redirect to={{ pathname: '/' }} />;
  // self.props.history.push('/');
  // };

  render() {
    return (
      <Router>
        <Header classname="fixed-top" />
        <Switch>
          <Route path="/home" component={Home1} />
          <Route exact path="/" component={Home} />
          <Route path="/signin" component={SignIn} />
          <Route path="/signup" component={SignUp} />
          <Route path="/donasi5000" component={Donasi5000} />
          <Route path="/donasi10000" component={Donasi10000} />
          <Route path="/donasi50000" component={Donasi50000} />
          <Route path="/checkout/:item_id" component={Checkout} />
          <Route path="/profile" component={Profile} />
          {/* <Route path="/mobil" component={Mobil} /> */}
          {/* <Route path="/barang" component={Barang} /> */}
          <Route path="/invoice/:item_id" component={Invoice} />
          <Route path="/donasi" component={Donasi} />
          {/* <Route path="/form" component={FormPage} /> */}
          <Route path="/item/:item_id" component={Detail} />
          <Route path="/add" component={AddItem} />
          <Route path="/delete" component={Delete} />
          <Route path="/trans" component={Transaksi} />
          <Route component={NotFound} />
          {/* <Route path="/input" component={CustomInput} /> */}
        </Switch>
        <Footer />
      </Router>
    );
  }
}

export default connect(
  "is_login",
  actions
)(MainRoute);
